import "./intro.scss";

export default function Intro() {
    return (
        <div className="intro" id="intro">
            <div className="left">
                <div className="imgContainer">
                    <img src="assets/daPic.png" alt="" />
                </div>
            </div>
            <div className="right">
                <div className="wrapper">
                    <h2>Hi There, I'm</h2>
                    <h1>Rohan Cherukuri</h1>
                    <h3>Aspiring Security & ML Engineer<span></span></h3>
                </div>
            </div>
        </div>
    );
}
